- input: "TEXT\x1CC00188367\x1CTEXT-00001\x1C\x1CF3XA\x1CWe are in receipt of your
    letter dated April 30 2010. The receipts disclosed on Line 17 were for the payment
    of Voter lists/Voter File access. The cost of these lists is determined by the
    size of list and this price properly reflects fair market value and the normal
    charge for similar lists in our state. All costs associated with the voter file
    are paid 100% out of the federal account.  We have also realized that an in-kind
    contribution from the Democratic National Committee was accidentally omitted from
    the original report. This amendment corrects the error.  The receipts reported
    on Schedule A Line 15 from  Wyden for Senate, Future PAC, Senate Democratic Leadership
    Fund and Democratic National Committee are offsets for the payment of rent, telephone
    and copies. The Democratic Party of Oregon shares office space with several organizations.
    We write one check to pay rent. The amount of rent paid by each organization is
    assessed at the usual and normal charge, determinined by the amount of space occupied
    by the organization. Schedule A Line 15 reflects receipts from various County
    party and candidate committees. The Democratic Party of Oregon offers our County
    Committees and candidates  a number of technology services at cost.  These sevices
    include website and email services. Payments for salaries and wages reported on
    Schedule H4 are for employees who spent less than 25% of their time on FEA or
    activities in connection with a Federal election. Employees who spend more than
    25% of their time on FEA or activities in connection with a Federal election are
    paid with 100% Federal funds as are their fringe benefits and reported on Line
    30b.\n"
